import React from "react";
import mercadoLibreImg from '../imagenes/mercado_libre.webp';
import '../css/Home.css';


function Home(){
    return(
        <div>
            <img src={mercadoLibreImg} className='App-logo' alt='Cartel de MercadoLibre'/>

        </div>
    );
}

export default Home;
